import React from "react";
import { Link } from "react-router-dom"; 

const markdownFiles = [
  {
    name: "카테고리1", type: 0,
    posts: [
      { name: "대학공부", type: 1 }, 
      { name: "유니티", type: 1 }
    ]
  },
  {
    name: "카테고리2", type: 0,
    posts: [
      { name: "자바스크립트", type: 1 }, 
      { name: "리액트", type: 1 }
    ]
  }
];

export default function Post() {

  return (
    
    <div>
      
      <h2>글 목록</h2>
      {markdownFiles.map((category, index) => (
        <div key={index}>
          <h3>{category.name}</h3>
          <div>
            {category.posts.map((post, idx) => (
              <Link key={idx} to={`/blog/${category.name}/${post.name}`}>
                <h4>{post.name}</h4>
              </Link>
            ))}
          </div>
        </div>
      ))}
    </div>
  );
};
